import React, { Component } from 'react';
import { BrowserRouter, Route } from 'react-router-dom'

import Home from "./components/Home"

const NewRoute = () => {
  return(
    <h1>hello</h1>
  );
};

function App() {
  return (
    <BrowserRouter>
      <Route path="/" component ={Home}/>
      <Route path="/new" component ={NewRoute}/>
    </BrowserRouter>
  );
}

export default App;
